/* eslint-disable react/prop-types */
import React , { use}from 'react';
import { Link } from 'react-router-dom';

const Report = ({ data }) => {
  const [menuOpen, setMenuOpen] = useState(false);

  handleBtnClick = () => {
    setMenuOpen(!menuOpen)
  };

  return (
  <div className="w3-container w3-margin-top" style={{ fontSize: '1.2em' }}>
    <div className="w3-round-xlarge w3-card-2 w3-light-gray">
      <div className="w3-container w3-margin">
        <div className="w3-container w3-margin-top">
          <span style={{ marginTop: '1em', paddingBottom: '10px', borderBottom: '1px solid grey' }}><b>{data.heading}</b></span>
        </div>
        <div className="w3-container w3-margin-top">
          <div className="w3-cell">
            <img src={data.image} alt="Avatar" className="w3-circle" style={{ width: '60px' }} />
          </div>
          <div className="w3-cell ">
            <p>
            <Link to="/creativity"><button
                type="button"
                className="w3-button w3-round-xxlarge w3-text-grey"
                style={{
                  paddingLeft: '2em', paddingRight: '2em', backgroundColor: '#ccc', marginLeft: '1.5em',
                }}
              >
                <b>{data.text}</b>

              </button>
              </Link>
            </p>
          </div>
        </div>
      </div>
    </div>
  </div>
);
}

export default Report;
